import React, {Component} from 'react';
import {
  HomeWrapper,
  HomeLeft,
  HomeRight
} from './style'
class Home extends Component { 
  render() {
    return (
      <HomeWrapper>
        <HomeLeft>
          <img src=""></img>
        </HomeLeft>
        <HomeRight>Right</HomeRight>

      </HomeWrapper>
    )
  }
}

export default Home;
